import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"

function ProdactDetetils(){
const usepatrams=useParams([])
let c=`https://fakestoreapi.com/products/${usepatrams.Detels}`;
const [data1,setdata]=useState([])
useEffect(()=>{
fetch(c)
.then(res=>res.json())
.then(data=>setdata(data))
},[])

return(
    
<div>

    {data1.title}
</div>
)
}
export default ProdactDetetils
